95\" class=\"mw-redirect\" title=\"1795\">1795<\/a>&#160;\u2014 \u041e \u0441\u0432\u043e\u0435\u0439 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u043e\u0432<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%9E%D1%81%D1%82-%D0%98%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u041e\u0441\u0442-\u0418\u043d\u0434\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0439 \u041e\u0441\u0442-\u0438\u043d\u0434\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0438 \u0436\u0438\u0442\u0435\u043b\u0438 \u0434\u0438\u0441\u0442\u0440\u0438\u043a\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BF%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BB%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0430\u043f\u0441\u043a\u0430\u044f \u043a\u043e\u043b\u043e\u043d\u0438\u044f\">\u041a\u0430\u043f\u0441\u043a\u043e\u0439 \u043a\u043e\u043b\u043e\u043d\u0438\u0438<\/a>&#160;\u2014 <a href=\"https:\/\/nl.wikipedia.org\/wiki\/Republiek_Graaff-Reinet\" class=\"extiw\" title=\"nl:Republiek Graaff-Reinet\">\u0425\u0440\u0430\u0444\u0444-\u0420\u0435\u0439\u043d\u0435\u0442<\/a>. \u0421\u043e\u0437\u0434\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8\" title=\"\u0411\u0443\u0440\u0441\u043a\u0438\u0435 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438\">\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1806\" class=\"mw-redirect\" title=\"1806\">1806<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u043e\u0432\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u043e\u0432\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B9_%D0%BF%D1%80%D0%B8_%D0%A1%D0%B0%D0%BD-%D0%94%D0%BE%D0%BC%D0%B8%D0%BD%D0%B3%D0%BE\" title=\"\u0411\u043e\u0439 \u043f\u0440\u0438 \u0421\u0430\u043d-\u0414\u043e\u043c\u0438\u043d\u0433\u043e\">\u0411\u043e\u0439 \u043f\u0440\u0438 \u0421\u0430\u043d-\u0414\u043e\u043c\u0438\u043d\u0433\u043e<\/a>&#160;\u2014 \u0431\u043e\u0439 \u043c\u0435\u0436\u0434\u0443 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u0438 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u044d\u0441\u043a\u0430\u0434\u0440\u0430\u043c\u0438 \u0443 \u043e\u0441\u0442\u0440\u043e\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D1%82%D0%BE-%D0%94%D0%BE%D0%BC%D0%B8%D0%BD%D0%B3%D0%BE\" title=\"\u0421\u0430\u043d\u0442\u043e-\u0414\u043e\u043c\u0438\u043d\u0433\u043e\">\u0421\u0430\u043d\u0442\u043e-\u0414\u043e\u043c\u0438\u043d\u0433\u043e<\/a>, \u043c\u0435\u0436\u0434\u0443 \u043c\u044b\u0441\u0430\u043c\u0438 \u041d\u0438\u0441\u0430\u043e \u0438 \u041a\u0430\u0442\u0430\u043b\u0430\u043d\u0430. \u041f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u043a\u043b\u0430\u0441\u0441\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u044d\u0441\u043a\u0430\u0434\u0440\u0435\u043d\u043d\u044b\u0439 \u0431\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BA_%D0%BF%D0%B0%D1%80%D1%83%D1%81%D0%B0\" title=\"\u0412\u0435\u043a \u043f\u0430\u0440\u0443\u0441\u0430\">\u0432\u0435\u043a\u0430 \u043f\u0430\u0440\u0443\u0441\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1807\" class=\"mw-redirect\" title=\"1807\">1807<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B9_%D0%BF%D1%80%D0%B8_%D0%93%D0%BE%D1%84%D0%B5\" title=\"\u0411\u043e\u0439 \u043f\u0440\u0438 \u0413\u043e\u0444\u0435\">\u0411\u043e\u0439 \u043f\u0440\u0438 \u0413\u043e\u0444\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1813\" class=\"mw-redirect\" title=\"1813\">1813<\/a>&#160;\u2014 \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043e\u043f\u0435\u0440\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BD%D0%BA%D1%80%D0%B5%D0%B4_(%D0%BE%D0%BF%D0%B5%D1%80%D0%B0)\" title=\"\u0422\u0430\u043d\u043a\u0440\u0435\u0434 (\u043e\u043f\u0435\u0440\u0430)\">\u0422\u0430\u043d\u043a\u0440\u0435\u0434<\/a>\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%BD%D0%B8,_%D0%94%D0%B6%D0%BE%D0%B0%D0%BA%D0%BA%D0%B8%D0%BD%D0%BE\" title=\"\u0420\u043e\u0441\u0441\u0438\u043d\u0438, \u0414\u0436\u043e\u0430\u043a\u043a\u0438\u043d\u043e\">\u0414\u0436\u043e\u0430\u043a\u043a\u0438\u043d\u043e \u0420\u043e\u0441\u0441\u0438\u043d\u0438<\/a> \u0432 \u0442\u0435\u0430\u0442\u0440\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0_%D0%A4%D0%B5%D0%BD%D0%B8%D1%87%D0%B5\" title=\"\u041b\u0430 \u0424\u0435\u043d\u0438\u0447\u0435\">\u041b\u0430 \u0424\u0435\u043d\u0438\u0447\u0435<\/a>\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0435\u043d\u0435\u0446\u0438\u044f\">\u0412\u0435\u043d\u0435\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815\" class=\"mw-redirect\" title=\"1815\">1815<\/a>&#160;\u2014 <a href=\"https:\/\/en.wikipedia.org\/wiki\/John_Stevens_(inventor)\" class=\"extiw\" title=\"en:John Stevens (inventor)\">\u0414\u0436\u043e\u043d \u0421\u0442\u0438\u0432\u0435\u043d\u0441<\/a> \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0433\u0440\u0430\u043d\u0442 \u0448\u0442\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%94%D0%B6%D0%B5%D1%80%D1%81%D0%B8\" title=\"\u041d\u044c\u044e-\u0414\u0436\u0435\u0440\u0441\u0438\">\u041d\u044c\u044e-\u0414\u0436\u0435\u0440\u0441\u0438<\/a> \u043d\u0430 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0438 \u00ab\u043f\u0440\u044f\u043c\u0438\u043a\u043e\u043c \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BB%D0%B0%D0%B2%D1%8D%D1%80_(%D1%80%D0%B5%D0%BA%D0%B0)\" title=\"\u0414\u0435\u043b\u0430\u0432\u044d\u0440 (\u0440\u0435\u043a\u0430)\">\u0440\u0435\u043a\u0438 \u0414\u0435\u043b\u0430\u0432\u044d\u0440<\/a>, \u0447\u0435\u0440\u0435\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D0%BD%D1%82%D0%BE%D0%BD_(%D0%9D%D1%8C%D1%8E-%D0%94%D0%B6%D0%B5%D1%80%D1%81%D0%B8)\" title=\"\u0422\u0440\u0435\u043d\u0442\u043e\u043d (\u041d\u044c\u044e-\u0414\u0436\u0435\u0440\u0441\u0438)\">\u0422\u0440\u0435\u043d\u0442\u043e\u043d<\/a>, \u043a \u0440\u0435\u043a\u0435 \u0420\u0435\u0440\u0438\u0442\u044d\u043d, \u0438 \u043e\u043a\u043e\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%91%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B8%D0%BA_(%D0%9D%D1%8C%D1%8E-%D0%94%D0%B6%D0%B5%D1%80%D1%81%D0%B8)\" title=\"\u041d\u044c\u044e-\u0411\u0440\u0430\u043d\u0441\u0443\u0438\u043a (\u041d\u044c\u044e-\u0414\u0436\u0435\u0440\u0441\u0438)\">\u041d\u044c\u044e-\u0411\u0440\u0430\u043d\u0441\u0443\u0438\u043a\u0430<\/a>\u00bb. \u042d\u0442\u043e \u043f\u0435\u044