dia.org\/wiki\/%D0%9A%D1%80%D1%83%D0%BF%D0%BD%D0%B5%D0%B9%D1%88%D0%B8%D0%B5_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D1%8B_XIX_%D0%B2%D0%B5%D0%BA%D0%B0\" title=\"\u041a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0435 \u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u044b XIX \u0432\u0435\u043a\u0430\">\u043a\u043e\u0440\u0430\u0431\u043b\u0435\u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0435 XIX<\/a> \u0432\u0435\u043a\u0430 \u043f\u043e\u0441\u043b\u0435 \u0433\u0438\u0431\u0435\u043b\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%BB%D1%82%D0%B0%D0%BD%D1%88%D0%B0\" title=\"\u0421\u0443\u043b\u0442\u0430\u043d\u0448\u0430\">\u0421\u0443\u043b\u0442\u0430\u043d\u0448\u0438<\/a>\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1832\" class=\"mw-redirect\" title=\"1832\">1832<\/a>&#160;\u2014 \u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D1%86%D0%B8%D1%8F_(1832)\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f (1832)\">\u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u043e\u0439 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1832_%D0%B3%D0%BE%D0%B4\" title=\"1832 \u0433\u043e\u0434\">1832 \u0433\u043e\u0434\u0430<\/a>, \u043f\u0440\u0438\u0437\u043d\u0430\u0432\u0448\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0447\u0435\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u0443\u044e \u0413\u0440\u0435\u0446\u0438\u044