wikipedia.org\/wiki\/%D0%94%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_%D0%92%D0%B0%D0%B9%D1%82%D0%B0%D0%BD%D0%B3%D0%B8\" title=\"\u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u0412\u0430\u0439\u0442\u0430\u043d\u0433\u0438\">\u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u0412\u0430\u0439\u0442\u0430\u043d\u0433\u0438<\/a>, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f<\/a> \u0441\u0442\u0430\u043b\u0430 \u043a\u043e\u043b\u043e\u043d\u0438\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1851\" class=\"mw-redirect\" title=\"1851\">1851<\/a>&#160;\u2014 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Bushfires_in_Australia\" class=\"extiw\" title=\"en:Bushfires in Australia\">\u041f\u043e\u0436\u0430\u0440 \u0431\u0443\u0448\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%B8%D1%8F_(%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F)\" title=\"\u0412\u0438\u043a\u0442\u043e\u0440\u0438\u044f (\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f)\">\u0448\u0442\u0430\u0442\u0435 \u0412\u0438\u043a\u0442\u043e\u0440\u0438\u044f<\/a> \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0438\u043b 5 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u043e\u0432 \u0433\u0435\u043a\u0442\u0430\u0440 \u0431\u0443\u0448\u0430 (\u0447\u0435\u0442\u0432\u0435\u0440\u0442\u044c \u0448\u0442\u0430\u0442\u0430). \u0422\