43e \u0421\u0442\u0430\u0432\u0438\u0441\u043a\u043e\u0433\u043e\">\u0434\u0435\u043b\u0430 \u0421\u0442\u0430\u0432\u0438\u0441\u043a\u043e\u0433\u043e<\/a>, \u043f\u0440\u0430\u0432\u044b\u0435 \u0430\u043d\u0442\u0438\u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0441\u0438\u043b\u044b \u0443\u0441\u0442\u0440\u043e\u0438\u043b\u0438 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D1%81%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%9F%D0%BE%D0%BB%D1%8F\" title=\"\u0415\u043b\u0438\u0441\u0435\u0439\u0441\u043a\u0438\u0435 \u041f\u043e\u043b\u044f\">\u0415\u043b\u0438\u0441\u0435\u0439\u0441\u043a\u0438\u0445 \u043f\u043e\u043b\u044f\u0445<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044e, \u0432\u044b\u043b\u0438\u0432\u0448\u0443\u044e\u0441\u044f \u0432 \u043d\u0435\u0443\u0434\u0430\u0447\u043d\u0443\u044e \u043f\u043e\u043f\u044b\u0442\u043a\u0443 \u0444\u0430\u0448\u0438\u0441\u0442\u0441\u043a\u043e\u0433\u043e \u043f\u0443\u0442\u0447\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936\" class=\"mw-redirect\" title=\"1936\">1936<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D1%80%D0%BC%D0%B8%D1%88-%D0%9F%D0%B0%D1%80%D1%82%D0%B5%D0%BD%D0%BA%D0%B8%D1%80%D1%85%D0%B5%D0%BD\" title=\"\u0413\u0430\u0440\u043c\u0438\u0448-\u041f\u0430\u0440\u0442\u0435\u043d\u043a\u0438\u0440\u0445\u0435\u043d\">\u0413\u0430\u0440\u043c\u0438\u0448-\u041f\u0430\u0440\u0442\u0435\u043d\u043a\u0438\u0440\u0445\u0435\u043d\u0435<\/a> \u0441\u0442\u0430\u0440\u0442\u043e\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1936\" title=\